import { useParams } from "react-router-dom";
import classes from "./MethodPage.module.css";
import { useEffect } from "react";
import { useSidebar } from "../../contexts/SidebarContext";
import { useNavbar } from "../../contexts/NavContext";
import SetChooser from "../../components/SetChooser/SetChooser";
import MethodChooser from "../../components/MethodChooser/MethodChooser";
import SetupPreview from "../../components/SetupPreview/SetupPreview";
interface MethodPage {
    pc: number;
}
const testSetups = [
    {
        name: "Legs",
        fumen: "v115@vhAAgH",
        totalCover: 0.21,
        solveRate: 0.84,
    },
    {
        name: "Jeremy",
        fumen: "v115@vhAAA8G",
        totalCover: 0.35,
        solveRate: 0.92,
    },
    {
        name: "Dragon",
        fumen: "v115@vhAAH",
        totalCover: 0.12,
        solveRate: 0.68,
    },
];
const MethodPage = ({ pc }: MethodPage) => {
    const { setSidebar } = useSidebar();
    const { setNavbar } = useNavbar();
    const { specificPC } = useParams();
    if (typeof specificPC === "string") {
        document.title = `${pc}${
            ["", "st", "nd", "rd", "th", "th", "th", "th"][pc]
        } PC • ${specificPC}`;
    }
    useEffect(() => {
        setSidebar(`${specificPC} Methods`, <MethodChooser />);
        setNavbar(
            <>
                <a
                    className={classes.link}
                    href={`../${
                        pc + ["", "st", "nd", "rd", "th", "th", "th", "th"][pc]
                    }`}
                >{`${pc}${
                    ["", "st", "nd", "rd", "th", "th", "th", "th"][pc]
                } PC`}</a>{" "}
                • {specificPC}
            </>,
            <></>
        );
    }, []);

    return (
        <div className={classes.methodPage}>
            <h1 className={classes.title}>Method: {specificPC}</h1>
            <div className={classes.setupList}>
                {testSetups.map((setup, idx) => (
                    <SetupPreview key={idx} {...setup} />
                ))}
            </div>
        </div>
    );
};

export default MethodPage;
